import TextBox from "./textBoxInPopUp"

function popUpSetTime() {
    return (
          <div id="popUp" className="h-screen w-full bg-black/50 absolute top-0 z-10 flex items-center justify-center">
                <div className="max-w-screen-sm mx-auto bg-slate-400 rounded flex flex-col">
                    <div className="bg-red-500 p-2 w-full rounded-t">
                        <span className="text-2xl">ก็อก</span>
                    </div>
                    <div className="p-4 flex flex-col items-between gap-2">
                        <TextBox label="วันที่" type="date" />
                        <TextBox label="เริ่มเปิดน้ำ" type="time" />
                        <TextBox label="เปิดกี่นาที" type="time" />
                        <div className="w-full bg-red-500 rounded text-xl text-center p-2">เพิ่ม</div>
                    </div>
                    
                </div>
                
          </div> 
    );
  }
  
  export default popUpSetTime;
